INSERT INTO `wp_posts` VALUES (2,1,'2017-02-20 22:26:27','2017-02-20 21:26:27','To jest przykładowa strona. Różni się ona od postu na blogu, ponieważ pozostanie ona ciągle w jednym miejscu i pokaże się w panelu nawigacyjnym na twojej stronie (w przypadku większości szablonów). Większość osób zaczyna od strony \'O mnie\' lub \'O nas\', która przedstawia ich potencjalnym odwiedzającym stronę. Może to być coś takiego:\n\n<blockquote>Cześć! Jestem kurierem na rowerze za dnia, nocą aktorem amatorem, a to jest mój blog. Mieszkam w Gdańsku, mam wspaniałego psa o imieniu Azor i uwielbiam pi&#241;a coladę. (Oraz to, kiedy łapie mnie deszcz.)</blockquote>\n\n...lub coś bardziej jak to:\n\n<blockquote>Firma XYZ została założona w 1971 roku i od tamtej pory wytwarza najlepszej jakości wihajster na rynku. Zlokalizowana w Pacanowie zatrudnia ponad 2000 osób i jest powodem samego dobrodziejstwa dla lokalnej społeczności.</blockquote>\n\nJako nowy użytkowni WordPressa, powinieneś odwiedzić <a href=\"http://roofer.dev/wp-admin/\">swój panel administracyjny</a>, aby skasować tę stronę i stworzyć nowe, dostosowane do Twoich potrzeb strony. Miłej zabawy!','Przykładowa strona','','trash','closed','open','','przykladowa-strona__trashed','','','2017-02-20 22:39:11','2017-02-20 21:39:11','',0,'http://roofer.dev/?page_id=2',0,'page','',0),(3,1,'2017-02-20 22:26:30','0000-00-00 00:00:00','','Automatycznie zapisany szkic','','auto-draft','open','open','','','','','2017-02-20 22:26:30','0000-00-00 00:00:00','',0,'http://roofer.dev/?p=3',0,'post','',0),(5,1,'2017-02-20 22:38:54','2017-02-20 21:38:54','Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet. Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labor